import React from "react"
import Navbar from "./Navbar"
import Details from "./MultiStepForm"
import Psql from ".././logos/Postgresql.png"



const PostgreSQL = () => {
    return(
        <>
        <div
        class="bg_image"
        style={{
          backgroundImage: `url(${Psql})`,
          backgroundSize: "cover",
          height: "100vh",
          color: "#f5f5f5"
        }}
      >
        <h1>This is Text on top</h1>
      </div>
        <div>
            <Navbar />
            <Details />
        </div>
        </>
    );
}

export default PostgreSQL;
